import React from "react";
import { BrowserRouter  } from "react-router-dom";
import Login from './components/login/login';
import Dashboard from "./components/dashboard";

const App =() =>{
  return (
    <Router>
      <Switch>
        <Route path="/dashboard">
          <Dashboard />
        </Route>
        <Route path="/">
          <Login />
        </Route>
      </Switch>
    </Router>
  );
};

export default App
